import React from "react";

const CardsFamourfor = ({ movie }) => {
  return (
    <div>
      {movie.popularity > 23.772 ? movie.poster_path : " "}
      {movie.popularity > 23.772 ? movie.title : " "}
    </div>
  );
};

export default CardsFamourfor;
